Πρώτη φορά το φωτοσοπάρισμα του εικονιδίου βγαίνει τόσο εύκολα (από μέρες που ήταν παλιά έγινε σε μέρα) και πάω ανυποψίαστος να ανεβάσω την εφαρμογή για review μέσα στην τρελή χαρά. Που να ξέρω ότι το σύμπαν για κάποιο λόγο είχε στραφεί εναντίον μου;

Συγκεκριμένα Σύμπαν = {ΔΕΗ, hol router, Apple}

Πρώτη χτύπησε η ΔΕΗ όπου 2 η ώρα την νύχτα θυμήθηκε να κόψει το ρεύμα. Ευτυχώς κράτησε κάτι λιγότερο από 10λεπτο, ίσα ίσα να σε αγχώσει.
Σειρά είχε να σταματήσει να δουλεύει σωστά το router. Λίγο το ασύρματο, λίγο γενικά η σύνδεση, έκαναν τα πάντα καλύτερα.
Αφού το ξεπέρασα και αυτό είχε μείνει μόνο να περάσω το βουνό που λέγεται Apple. Για να ανεβάσω τον εκτελέσιμο κώδικα της εφαρμογής πρέπει πρώτα να δημιουργήσω την ερφαρμογή στο site τις Apple. Επειδή όμως λόγω όλων των προηγουμένων που συνέβησαν ήμουν πολύ συγκεντρωμένος, έγινε κοτσάνα, έπρεπε να σβήσω την εικονική/ονομαστική εφαρμογή από το site της Apple και να την ξαναυποβάλλω. Για κάποιο άγνωστο λόγο όμως, αν το κάνεις αυτό η Apple δε σου επιτρέπει να χρησιμοποιήσεις ξανά το ίδιο όνομα στην εφαρμογή. Θα σκέφτηκε ότι για να το σβήνεις μάλλον δε θες να το ξαναδείς ποτέ μπροστά σου και για σιγουριά δε σε αφήνει να το ξαναχρησιμοποιήσεις.
Μετά από όλα αυτά όμως το πείσμα νίκησε. Ιδού λοιπόν:

<a href="http://ozmaxplanet.com/wp-content/uploads/2013/04/Screenshot-42013-451-AM.jpeg"><img class="aligncenter size-medium wp-image-172" alt="Screenshot 4:20:13 4:51 AM" src="http://ozmaxplanet.com/wp-content/uploads/2013/04/Screenshot-42013-451-AM-300x170.jpeg" width="300" height="170" /></a>

&nbsp;

Ελπίζω η καρμική ισσοροπία να αποκατασταθεί περνώντας το review!

Με ένα κρυφό παράπονο που δεν έλυσα ποτέ το μυστήριο του Mognet Central και που όπως φαίνεται δεν θα βρεθεί ποτέ ξανά χρόνος για μια ακόμα προσπάθεια.
Anyway had lots 'o fun :'-)

